    "desc_para2": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uAC1C\uBC1C\uC744 \uC704\uD574 \uC5F4\uC2EC\uD788 \uB178\uB825\uD558\uACE0 \uC788\uC73C\uBA70 \uC2DC\uAC04\uC774 \uC9C0\uB0A8\uC5D0 \uB530\uB77C \uAC1C\uC120\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4." } },
    "desc_para3": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uAC1C\uBC1C\uC744 \uCD09\uC9C4\uD558\uAE30 \uC704\uD574\uC11C, \uAE43\uD5C8\uBE0C \uC2A4\uD3F0\uC11C\uB97C \uD1B5\uD574 \uD300\uC744 \uD6C4\uC6D0\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. Elk\uB97C \uC990\uACA8\uC8FC\uC2DC\uAE30 \uBC14\uB78D\uB2C8\uB2E4!" } },
    "desc_para4": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "Elk\uB294 \uC624\uD508\uC18C\uC2A4\uC785\uB2C8\uB2E4. \uB9CC\uC57D \uD14C\uC2A4\uD2B8, \uD53C\uB4DC\uBC31 \uC81C\uACF5 \uB610\uB294 \uAE30\uC5EC\uB97C \uB3D5\uACE0 \uC2F6\uC73C\uC2DC\uB2E4\uBA74," } },
    "desc_para5": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uC6B0\uB9AC\uC758 \uAE43\uD5C8\uBE0C\uC5D0 \uB4E4\uC5B4\uAC00\uC11C" } },
    "desc_para6": { "t": 0, "b": { "t": 2, "i": [{ "t": 3 }], "s": "\uCC38\uC5EC\uD558\uC138\uC694." } },
